social_posts.post_text:
THANK YOU POST! 
AS8 was a huge opportunity for me to showcase the Drag I knew I always was capable of doing. I was very fortunate that I was in the perfect position to go back. Being apart of Drag Race Live working 5 nights a week I had a fierce savings that really helped me to pay for the looks I wanted to do. It really was divine timing! I had this huge self discovery, found my confidence not only as an entertainer but in real life, and I had the money to give it my all esthetically. I however couldn’t do any of this without the love and support of every designer & hairstylist who really came through for me. I only wanted to work with people I truly knew believed in me & that’s where the magic truly started. Huge thank you to 
@mross4ever who made majority of my looks literally to the last second of me leaving Vegas for filming
@omgeewigs who made majority of my wigs and did it so quickly.
@onlyonecalvi who made my ruveal look & my cheerleading talent
@ampedaccessories who made my all my jewelry and costume Body piece for my pageant runway
@edwardsizzahands2.0 Forbes my custom banana hair
@silkyganache & @mizakeriachanel for my grace jones look and just being a great support system throughout this whole journey.
@joshuanapontedesigns slayed my banana &  bringing my Finale look to life. That was such a spiritual beautiful experience from start to finish.
@daviddewer who made my winning Aries look and really was so excited and believed in me from the start! I will cherish our friendship forever!
@jeffreykellydesigns who made my lil nas x look
@dmvrtinez.jpg shot my looks and got them to me so quickly. Your energy on set really helped me so much!

I am forever grateful to you all for believing in me. Going home early on my original season a lot of designers didn’t trust me enough to work with them and I these people absolutely had my back and full faith in me. Thank you from the bottom of my heart!

#love #allstars8 #art #fashion
